import styled from 'styled-components'

export const SvgPortfolio =styled.svg`
    width: 100%;
    height: 90vh;
    position:absolute;
    opacity: 20%;
`;

export const GrainyBackgroundContainer =styled.div`
    display:flex;
    justify-content:center;
    align-items:center;
    position:relative;
    height: 100vh;
    background:'#8c8c8c';
`;
